　　　(4) 薬によりアレルギー症状を起こしたことがある人。<br>
<br>
　2.次の場合は、直ちに使用を中止し、この製品を持って医師、歯科医師、又は薬剤師に相談してください<br>
　　　(1) 使用後、次の症状があらわれた場合。<br>
　　　　　・皮ふ：発疹・発赤、かゆみ<br>
