【コルゲンコーワトローチの詳細】<br>
●のどの炎症をおさえるだけでなく、炎症が悪化しないようにしますので、のどの痛みやはれ、声がれにすぐれた効果を発揮します。<br>
●のどにきたら、口の中でかまずに、できるだけゆっくり溶かして服用してください。<br><br>

【効能・効果】<br>
のどの炎症によるのどの痛み・のどのはれ・のどの不快感・声がれ・のどのあれ、口腔内の殺菌・消毒、口臭の除去<br><br>

【用法 用量】<br>
成人(15歳以上)は1回1コを1日4～5回、小児(5歳以上15歳未満)は、1回1コを1日2～3回、口の中でかまずにできるだけゆっくり溶かして用いる。<br><br>

【ご注意】<br>
●使用上の注意<br>
相談すること<br>
1.次の人は使用前に医師、歯科医師又は薬剤師に相談すること<br>
(1)医師又は歯科医師の治療を受けている人<br>
(2)本人又は家族がアレルギー体質の人<br>
(3)薬によりアレルギー症状を起こしたことがある人<br>
2.次の場合は、直ちに使用を中止し、この外箱を持って医師、歯科医師又は薬剤師に相談すること<br>
(1)使用後、次の症状があらわれた場合<br>
関係部位・・・皮ふ<br>
症状・・・発疹・発赤、かゆみ<br>
(2)5～6日間使用しても症状がよくならない場合<br>
●保管及び取扱い上の注意<br>
・高温をさけ、直射日光の当たらない湿気の少ない涼しい所に保管すること。<br>
・小児の手の届かない所に保管すること。<br>
・他の容器に入れ替えないこと。(誤用の原因になったり品質が変わる)<br>
・PTPのアルミ箔が破れたり、中身のトローチが破損しないように、保管及び携帯に注意すること。<br>
・使用期限(外箱に記載)をすぎた製品は使用しないこと。<br>
●成分・分量に関連する注意：本剤には生薬が配合されているので、製品により色が多少異なることがある。<br><br>

【成分】5個中<br>
グリチルリチン酸二カリウム：15.0mg、セチルピリジニウム塩化物水和物：5.0mg、セネガ乾燥エキス：23.95mg(セネガとして400mg)<br>
添加物：ブドウ糖、白糖、乳糖、ヒドロキシプロピルセルロース、黄色五号、デキストリン、L-メントール、香料、ステアリン酸Mg<br><br>

【内容量】<br>
24個入<br><br>

